window.jsData("2f0340f8-07c7-4b84-914f-59dfec18dba0", [{"start":{"type":"kTopicStart","text":"// kTopicStart","params":{},"lineIndex":0},"content":"\n/**\n * branching and iteration\n */\n#include<stdio.h>\n\nint main(int argc, char* argv[]) {\n    int a = 4, b = 5, c = 20, d = 6;\n    if(a < b) {\n        c--;\n    } else if(a == b){\n        c += 4;\n    } else {\n        c++;\n    }\n\n    // conditional expression\n    int e = (a < b) ? --d: ++d;\n\n    printf(\"c: %d\\n\", c);\n    printf(\"e: %d\\n\", e);\n\n    switch (a + 2) {\n        case 6:\n            printf(\"case 1\\n\");\n            break;\n        case 5:\n            printf(\"case 2\\n\");\n            break;\n        default:\n            printf(\"default case\\n\");\n    }\n\n    // while loop\n    int n = 4;\n\n    while(n) {\n        printf(\"while loop print %d\\n\", n--);\n    }\n\n    // do-while loop\n    int m = 2;\n    do {\n        printf(\"execute do block\\n\");\n        m--;\n    } while(m);\n\n    // for loop\n    for(int w = 1; w > 0; w--) {\n        printf(\"for loop %d\\n\", w);\n    }\n\n    // break and continue\n    int con = 0;\n    while(1) {\n        if(con > 3) {\n            break;\n        } else if(con > 2) {\n            con++;\n            continue;\n        }\n        printf(\"break and condition\\n\");\n        con++;\n    }\n\n    // GOTO\n    int r = 10;\n    r++;\n    goto result;\n    r++;\n    result: printf(\"goto line: %d\", r);\n}","end":{"type":"kTopicEnd","text":"// kTopicEnd","params":{},"lineIndex":73},"description":"","format":"c","console":"c: 19\ne: 5\ncase 1\nwhile loop print 4\nwhile loop print 3\nwhile loop print 2\nwhile loop print 1\nexecute do block\nexecute do block\nfor loop 1\nbreak and condition\nbreak and condition\nbreak and condition\ngoto line: 11"}]);